    (DOCRS) is a repository of building construction and real property based documents
    that have been completed.  The documents are archival in nature and the system is
    accessed by CFM personnel and authorized station engineering personnel.  Access
    to these documents limited due to security concerns because many of the documents
    are building plans type documents for structures throughout the VA.  DOCRS is a
